INSERT INTO `problem` VALUES (1000,'demo test','<p>Calculate a + b.</p>','<p>&nbsp;</p>\n<p class=\"p1\">Two integers a and b, separated by a space. (0&lt;=a,b&lt;=9).</p>','<p>&nbsp;</p>\n<p class=\"p1\">The sum of a and b in the first line.</p>','5 7','12','0','<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">Your program should always read from stdin(Standard Input), and write to stdout(Standard Output). Solutions to problem 10000 can be as follows:</p>\n<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">C:</p>\n<p class=\"p1\">#include</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">int main() {</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;int a, b;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;scanf(\"%d%d\", &amp;a, &amp;b);</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;printf(\"%d\\n\", a + b);</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;return 0;</p>\n<p class=\"p1\">}</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">C++:</p>\n<p class=\"p1\">#include</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">using namespace std;</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">int main() {</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;int a, b;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;cin &gt;&gt; a &gt;&gt; b;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;cout &lt;&lt; a + b &lt;&lt; endl;</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;return 0;</p>\n<p class=\"p1\">}</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">Pascal:</p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\">var</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;a, b: Integer;</p>\n<p class=\"p1\">begin</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;readln(a, b);</p>\n<p class=\"p1\">&nbsp;&nbsp;&nbsp;&nbsp;writeln(a + b);</p>\n<p class=\"p1\">&nbsp;</p>\n<p class=\"p1\">end.</p>','','2016-06-19 15:39:27',1,10,'N',1,2,0),(1001,'isPrime(maxK-minK)','<p>&nbsp; &nbsp; 给定一个长度为N(0&lt;n&lt;=10000)的序列，保证每一个序列中的数字a[i]是小于maxlongint的非负整数 ，编程要求求出整个序列中第k大的数字减去第k小的数字的值m，并判断m是否为质数。(0&lt;k&lt;=n)</p>','<p>输入格式：</p>\n<p>第一行为2个数n，k（含义如上题）</p>\n<p>第二行为n个数，表示这个序列</p>','<p>输出格式：</p>\n<p>如果m为质数则</p>\n<p>第一行为\'YES\'(没有引号）</p>\n<p>第二行为这个数m</p>\n<p>否则&nbsp;</p>\n<p>第一行为\'NO\'</p>\n<p>第二行为这个数m</p>','5 2\n1 2 3 4 5','YES\n2','0','<p>对于第K大的详细解释:</p>\n<p>如果一个序列为1 2 2 2 2 3</p>\n<p>第1大 为3</p>\n<p>第2大 为2</p>\n<p>第3大 为2</p>\n<p>第4大 为2</p>\n<p>第5大 为1</p>\n<p>第K小与上例相反</p>\n<p>&nbsp;</p>\n<p>另外需要注意的是</p>\n<p>最小的质数是2,如果小于2的话,请直接输出NO</p>','','2016-06-30 19:20:25',5,10,'Y',NULL,0,0),(10,'小熊的购物单','<p><span style=\"color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; font-size: 13px; line-height: 26px; text-indent: 26px; background-color: rgba(255, 255, 255, 0.65098);\">小熊今天很开心，家里购置的新房就要领钥匙了，新房里有一间他自己专用的很宽敞的房间。更让他高兴的是，妈妈昨天对他说：&ldquo;你的房间需要购买哪些物品，怎么布置，你说了算，只要不超过N 元钱就行&rdquo;。今天一早金明就开始做预算，但是他想买的东西太多了，肯定会超过妈妈限定的N 元。于是，他把每件物品规定了一个重要度，分为5 等：用整数1~5 表示，第5 等最重要。他还从因特网上查到了每件物品的价格（都是整数元）。他希望在不超过N 元（可以等于N 元）的前提下，使每件物品的价格与重要度的乘积的总和最大。设第j 件物品的价格为v[j]，重要度为w[j]，共选中了k 件物品，编号依次为j1...jk，则所求的总和为：v[j1]*w[j1]+..+v[jk]*w[jk]请你帮助金明设计一个满足要求的购物单.</span></p>','<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">输入的第1 行，为两个正整数，用一个空格隔开：</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">N m</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">（其中N（&lt;30000）表示总钱数，m(&lt;25)为希望购买物品的个数。）</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">从第2 行到第m+1 行，第j 行给出了编号为j-1</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">的物品的基本数据，每行有2 个非负整数</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">v p</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">（其中v 表示该物品的价格（v&le;10000），p 表示该物品的重要度（1~5））</p>','<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">输出只有一个正整数，为不超过总钱数的物品的价格与重要度乘积的总和的</p>\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; text-indent: 2em; line-height: 2em; color: #333333; font-family: \'Microsoft YaHei\', \'Hiragino Sans GB\', \'ST Heiti\', \'LiHei Pro Medium\', \'Microsoft Jhenghei\', \'Wenquanyi Micro Hei\', \'WenQuanYi Zen Hei\'; background-color: rgba(255, 255, 255, 0.65098);\">最大值（&lt;100000000）</p>','1000 5\n800 2\n400 5\n300 5\n400 3\n200 2','3900','0','<p>动态规划</p>','','2016-06-20 15:54:52',2,10,'Y',NULL,0,0),(1002,'Highest Scholarship','<p>某校的惯例是在每学期的期末考试之后发放奖学金。发放的奖学金共有五种，获取的条件各自不同：</p>\n<p>1) &nbsp; &nbsp; 院士奖学金，每人8000元，期末平均成绩高于80分（&gt;80），并且在本学期内发表1篇或1篇以上论文的学生均可获得；</p>\n<p>&nbsp;</p>\n<p>2) &nbsp; &nbsp; 五四奖学金，每人4000元，期末平均成绩高于85分（&gt;85），并且班级评议成绩高于80分（&gt;80）的学生均可获得；</p>\n<p>&nbsp;</p>\n<p>3) &nbsp; &nbsp; 成绩优秀奖，每人2000元，期末平均成绩高于90分（&gt;90）的学生均可获得；</p>\n<p>&nbsp;</p>\n<p>4) &nbsp; &nbsp; 西部奖学金，每人1000元，期末平均成绩高于85分（&gt;85）的西部省份学生均可获得；</p>\n<p>&nbsp;</p>\n<p>5) &nbsp; &nbsp; 班级贡献奖，每人850元，班级评议成绩高于80分（&gt;80）的学生干部均可获得；</p>\n<p>&nbsp;</p>\n<p>只要符合条件就可以得奖，每项奖学金的获奖人数没有限制，每名学生也可以同时获得多项奖学金。例如姚林的期末平均成绩是87分，班级评议成绩82分，同时他还是一位学生干部，那么他可以同时获得五四奖学金和班级贡献奖，奖金总数是4850元。</p>\n<p>&nbsp;</p>\n<p>现在给出若干学生的相关数据，请计算哪些同学获得的奖金总数最高（假设总有同学能满足获得奖学金的条件）。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>','<p>&nbsp;输入的第一行是一个整数N（1 &lt;= N &lt;= 100），表示学生的总数。接下来的N行每行是一位学生的数据，从左向右依次是姓名，期末平均成绩，班级评议成绩，是否是学生干部，是否是西部省份学生，以及发表的论文数。姓名是由大小写英文字母组成的长度不超过20的字符串（不含空格）；期末平均成绩和班级评议成绩都是0到100之间的整数（包括0和100）；是否是学生干部和是否是西部省份学生分别用一个字符表示，Y表示是，N表示不是；发表的论文数是0到10的整数（包括0和10）。每两个相邻数据项之间用一个空格分隔。</p>','<p>输出包括三行，第一行是获得最多奖金的学生的姓名，第二行是这名学生获得的奖金总数。如果有两位或两位以上的学生获得的奖金最多，输出他们之中在输入文件中出现最早的学生的姓名。第三行是这N个学生获得的奖学金的总数。</p>','4\nYaoLin 87 82 Y N 0\nChenRuiyi 88 78 N Y 1\nLiXin 92 88 N N 0\nZhangQin 83 87 Y N 1\n','ChenRuiyi\n9000\n28700\n','0','','','2016-06-30 20:10:01',10,100,'Y',NULL,0,0),(1003,'Sea Bright Codes','<p class=\"p1\"><span class=\"s1\">Given N, B, and D: Find a set of N codewords (1 &lt;= N &lt;= 64), each of length B bits (1 &lt;= B &lt;= 8), such that each of the codewords is at least SB&nbsp;distance of D (1 &lt;= D &lt;= 7) away from each of the other codewords. The SB&nbsp;distance between a pair of codewords is the number of binary bits that differ in their binary notation. Consider the two codewords 0x554 and 0x234 and their differences (0x554 means the hexadecimal number with hex digits 5, 5, and 4):</span></p>\n<p class=\"p1\"><span class=\"s1\">0x554 = 0101 0101 0100 0x234 = 0010 0011 0100 Bit differences: xxx xx</span></p>\n<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Since five bits were different, the SB&nbsp;distance is 5.</span></p>','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">N, B, D on a single line</span></p>','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">N codewords, sorted, in decimal, ten per line. In the case of multiple solutions, your program should output the solution which, if interpreted as a base 2^B integer, would have the least value.</span></p>','16 7 3','0 7 25 30 42 45 51 52 75 76 82 85 97 102 120 127','0','<p class=\"p1\"><span class=\"s1\">There are only a few tools we need to solve this problem. First of all, we can use basic techniques to find the Nth bit of a number M: counting the least significant bit as bit 0, the next bit as bit 1, etc., we can find the value of that bit through the expression</span></p>\n<p class=\"p1\"><span class=\"s1\">int Nth_bit = (1 &lt;&lt; N) &amp; M;</span></p>\n<p class=\"p1\"><span class=\"s1\">In other words, we are shifting the number 1 left by N spaces, and then performing a binary AND on the resulting number with our original number, which will leave either a 1 in the Nth bit or a 0. So the first thing we have to do is find out the distance between each pair of numbers within the set of all numbers with B bits (0..2B-1).</span></p>\n<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">We also know that 0 can be one of the numbers in the set, because if the minimum number in the set were N instead of 0, we could XOR N to each number in the set and they would still be the same distance apart. The limits on the problem are low enough that we can do a DFS(depth first search), and as soon as we hit a solution we can output it and exit.</span></p>','','2016-07-01 01:33:06',5,10,'N',2,2,0),(101,'Summing a Series  ','<p>Sum a given integer series.</p>','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">&nbsp;series of positive integers, one per line. Proceed to the end of input.</span></p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">One integer, which is the sum of the input series. Our input guarantees the correct answer will never exceed&nbsp;</span></span><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\"><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">2</span></span></span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">31</sup><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">-1.</span></p>','3\n9\n7','19','0','<p>&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">How to detect the end of input?</span></p>','','2016-07-01 23:11:00',1,1,'N',1,2,0),(102,'Compass Moving','<p>You are given a tower of n disks, initially stacked in decreasing size on one of three pegs, your objective is to transfer the entire tower to one of the other pegs, moving only one disk at a time and never moving a larger one onto a smaller. &nbsp;</p>\n<p>For example, n = 2:</p>\n<p><a style=\"text-align: -webkit-center; background-color: #e8e8ff;\"><span style=\"background-color: #ffffff; font-size: 14px;\"><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><img src=\"data/102/102.png\" alt=\"hanoi\" /></span></span></a></p>\n<p>We need 3 moves to perform the task.</p>\n<p>&nbsp;</p>\n<p>Now the question arises: What\'s the best we can do? That is, how many moves are necessary and sufficient to perform the task? &nbsp; Please write a program to find out the minimum number of moves we need to do with n disks in the tower.</p>','<p>One positive integer, n (1 &lt;= n &lt;= 64).</p>','<p>One integer, the minimum number of moves needed.</p>','2','3','0','<p>The answer might be a huge integer which cannot be hold in a 32-bit int variable.</p>','','2016-07-01 23:17:21',5,10,'N',1,1,0),(103,'Prime Test','<p>A prime number (or prime integer, often simply called a \"prime\" for short) is a positive integer p&gt;1 that has no positive integer divisors other than 1 and p itself. &nbsp;For example, the only divisors of 13 are 1 and 13, making 13 a prime number, while the number 24 has divisors 1, 2, 3, 4, 6, 8, 12, and 24 (corresponding to the factorization 24=23*3), making 24 not a prime number. Positive integers other than 1 which are not prime are called composite numbers. &nbsp;Given an integer n, write a program to check whether n is a prime number or not.</p>','<p>One integer, n. (2&lt;=n&lt;=<span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">31</sup>&nbsp;-1).</p>','<p>Output \"YES\" if n is a prime number, otherwise \"NO\".</p>','2','YES','0','','','2016-07-01 23:29:40',2,32,'N',1,1,0),(104,'Prime Refactorying','<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">For a given integer, Prime Refactorying is finding which prime numbers you need to multiply together to get the original number, also called prime decomposition. &nbsp; Given a positive integer n&gt;=2, the prime refactorying&nbsp;is written</span></span><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">n = p<sub>1</sub><sup>a<sub>1</sub></sup>p<sub>2</sub><sup>a<sub>2</sub></sup>...p<sub>k</sub><sup>a<sub>k</sub></sup></em><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" />where the pis are the k prime factors, each of order ai. &nbsp;</p>\n<p>Write a program to factor a given integer n.</p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">One integer,&nbsp;</span><em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">n</em><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">. (2&lt;=</span><em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">n</em><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">&lt;=2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">31</sup><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">-1).</span></p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">Output the refactorying of n as follows: &nbsp;</span></span></p>\n<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体;\"><span style=\"font-size: 14px;\">n=p1(a1)p2(a2)...pk(ak) &nbsp;Where p1&lt;p2&lt;...&lt;pk, and ai denotes the exponent of pi.</span></span><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">For example, for&nbsp;</span><em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">n</em><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">&nbsp;= 1500 = 2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">2</sup><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">*3*5</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">3</sup><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">, the output should be:</span><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" /><br style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\" />1500=2(2)3(1)5(3)</p>','15','15=3(1)5(1)','0','','','2016-07-01 23:33:16',0,0,'N',1,1,0),(106,'The last non-zero digit of n!','<p>Given an integer n, please output the last non-zero digit of n! &nbsp;</p>\n<p>For example, 5!=120, the last non-zero digit is 2, for 9!=362880 it is 8.</p>','<p><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">One positive integer&nbsp;</span><em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">n</em><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">. (0&lt;</span><em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">n</em><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">&lt;10</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">10001</sup><span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">)</span></p>','<p>The last non-zero digit of n!</p>','1','1','0','','','2016-07-02 13:55:51',5,64,'N',NULL,0,0),(107,'a^b mod c','<p>The calculation of&nbsp;<em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: rgb(232, 232, 255);\"><strong>a<sup>b</sup>&nbsp;mod c</strong></em>&nbsp;arises in many fields of computer science, this time we brought it to you, can you prove us your talent?</p>','<p>Three integers, a, b, c. (1&lt;=a,b,c&lt;=<span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">31</sup>-1)</p>','<p>One integer, the result of&nbsp;<em style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">a</em><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\"><em>b</em></sup>&nbsp;mod c.</p>','3 7 15','12','0','<p>The operator mod is defined as calculating the reminder of a divides b. For example, 5 mod 1 = 0, 5 mod 2 = 1, 5 mod 3 = 2, 5 mod 4 = 1, 5 mod 5 = 0, 5 mod 6 = 5, 5 mod 7 = 5, 5 mod 8 = 5, etc. &nbsp;</p>\n<p>The operator mod has following properties:</p>\n<p>(a + b) mod c = ((a mod c) + b) mod c &nbsp;</p>\n<p>(a - b) mod c = ((a mod c) - b) mod c &nbsp;</p>\n<p>(a * b) mod c = ((a mod c) * b) mod c &nbsp;</p>\n<p>It is obvious that (a + b) mod c = ((a mod c) + (b mod c)) mod c, and etc.</p>','','2016-07-02 14:04:50',1,64,'N',1,1,0),(108,'BCD and SCM','<p>In mathematics, privided N positive integers,there exists maximum integer which can be divided among those integers without remainder,meanwhile,there exists minmum integer which can divide each of those intergers without remainds.</p>\n<p>In this problem, we define the BCD of an integer series as the largest positive integer that divides every number of that series without remainder. And the SCM of an integer series as the smallest positive integer that is a multiple of every number of the series. &nbsp;</p>\n<p>For example, for the following integer series: &nbsp;</p>\n<p>8 16 12 24 &nbsp;</p>\n<p>We have&nbsp;BCD&nbsp;= 4 and&nbsp;SCM&nbsp;= 48. &nbsp;</p>\n<p>You are given an non-negative integer series, please calculate its&nbsp;BCD&nbsp;and&nbsp;SCM.</p>','<p>The input will consist of a number of non-negative integers, one per line. Proceed to the end of input.</p>','<p>Two integers, the series\' BCD and SCM, separated by a single space. Our input guarantees the correct answer will never exceed&nbsp;<span style=\"font-family: Arial, Helvetica, sans-serif, 宋体; font-size: 14px; background-color: #e8e8ff;\">2</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">63</sup>-1.</p>','8 16 12 24','4\n48','0','','','2016-07-02 14:20:52',1,64,'N',1,1,0),(1004,'Ali Baba and the 40 Robbers','<p class=\"p1\"><span class=\"s1\">One day, Alibaba, as usual, drives his three donkeys to the forest to collect woods. After his hard work, finally he gets enough woods. ?He puts the woods on the back of these donkeys and goes home happily. Just after he goes through a high mountain, he sees a cloud of dust. It seems to have a group of people coming. ?He has been warned that there are a lot of thieves around this area recently. So he ties the donkeys to a tree, hiding himself behind a large rock.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Just a while, these people come, with the horses fully-loaded. Ali Baba don\'t know what\'s in the bags. However, he is sure that they are not to woods. The group has 40 persons. Ali Baba decides to see what makes them to take so many things to the mountains.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">The group of people come to a foot of the mountain. Ali Baba follows them there quietly. He knew that once found he would be killed. Though they speak briefly in a low voice, he is fully aware of the fact that this is a group of robbers and the things are stolen. However, why they took things at the foot of this mountain? Ali Baba decides to continue observing.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">The robber leader go in front of the mountain, says: \"Open, Simsim.\" As a big piece of stone answers and removes. There is a cave.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">The robbers move the things into the cave and then come out. The robber leader says: \"Close, Simsim.\" and the stone move back. The cave disappeared. Then the group of robbers go back.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Ali Baba remember this place and the sentence. Of course, he is very surprised about what has happened.</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">Ali Baba decides to take a look at the hidden treasures. He waits until the the robbers go far away, then come to the front of the cave.</span></p>\n<p class=\"p1\"><span class=\"s1\">He has never done such a thing. The legs has begun shaking up. However, he eventually encourages himself and shouts loudly: \"Open, Simsim.\"</span></p>\n<p class=\"p2\">&nbsp;</p>\n<p class=\"p1\"><span class=\"s1\">the stone removes and exposes a black hole. He goes into cave and is shocked by the scene inside. ?This is a very large cave, which is full of valuable gold, silver, jewelry and jade. He has never seen so many treasures in all his life. ?Ali Baba is a bit afraid of the robbers\' returning. So he runs back to the hole. However, Ali Baba thinks, why not take some back, as he has already here?</span></p>\n<p class=\"p2\"><span class=\"s1\">&nbsp;</span></p>\n<p class=\"p1\"><span class=\"s1\">So he throw away all the woods on the dunkeys in order to fill three large bags with treasures inside, and then out of the cave. \"Close, Simsim.\" Ali Baba says. The stone then block the hole.&nbsp;</span></p>\n<p class=\"p1\"><span class=\"s1\">Ali Baba leads the donkey to the forests, covered the treasure with wood in order to avoid any suspicion of oth</span>ers, and then goes home happily.</p>','<p>Each test data has two positive integer N, K (1&le;K&le;N&le;1000), separate by a space character.</p>\n<p>N is number of all drawers;K is number of breaked drawers.</p>','<p>Output the float number of the answer. Accurate to three digits after decimal point.</p>','3 1','0.333','0','','','2016-07-02 14:57:30',1,64,'N',NULL,0,0),(105,'Round Robin Killing','<p>n men stands in a format of circle under the commander that every <span style=\"font-size: 14px;\">m</span><sup style=\"font-family: Arial, Helvetica, sans-serif, 宋体; background-color: #e8e8ff;\">th&nbsp;</sup>man will be executed going around the circle until only one remains, find the position L(n,m) of the circle&nbsp;where&nbsp;you should stand in order to be the last survivor. &nbsp;</p>\n<p>For example, n = 5 and m = 2, we number everyone from 1 to n based on their positions, and the entire process will be as follows:</p>\n<p><img src=\"/data/105/105.png\" alt=\"Josephus\" /></p>\n<p>In this case we should stand at position 3 thus we can escape from being executed. &nbsp;</p>\n<p>&nbsp;</p>\n<p>Now you are given n and m, your task is to write a program to find the position of the last survivor.</p>','<p>Two integers n and m, separated by a single space. (1 &lt;= n, m &lt;= 1000000).</p>','<p>One integer, the position of the last survivor.</p>','5 2','3','0','','','2016-07-02 03:02:40',1,64,'N',1,1,0),(109,'求幂运算','<p>请精确计算 <span style=\"font-size: 16px;\">T</span><sup style=\"font-family: &quot;Times New Roman&quot;, Times, serif;\">n&nbsp;</sup>的值，其中&nbsp;<span style=\"font-family: &quot;Times New Roman&quot;, Times, serif; font-size: 16px;\">&nbsp;0.0 &lt; T &lt; 99.999、 0 &lt; n &lt;= 25</span></p>','<p>输入由两组数组成 T、 n。T占位列数为1到6，n占位列数为8到9</p>','<p>输出每一行为一个<span style=\"font-size: 16px;\">T</span><sup style=\"font-family: &quot;Times New Roman&quot;, Times, serif;\">n</sup>的结果</p>\n<p>如果该数（0&lt;<span style=\"font-size: 16px;\">T</span><sup style=\"font-family: &quot;Times New Roman&quot;, Times, serif;\">n</sup>&lt;1）,小数点前的0省略</p>\n<p>如果该数有小数，小数最后不能以0结尾</p>\n<p>如果该数是整数，末尾不能有小数点&nbsp;</p>','95.123 12\n0.4321 20\n5.1234 15\n6.7592  9\n98.999 10\n1.0100 12','548815620517731830194541.899025343415715973535967221869852721\n.00000005148554641076956121994511276767154838481760200726351203835429763013462401\n43992025569.928573701266488041146654993318703707511666295476720493953024\n29448126.764121021618164430206909037173276672\n90429072743629540498.107596019456651774561044010001\n1.126825030131969720661201','0','<p>判断输入数据结束<span style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">:&nbsp;</span><br style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\" /><em style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">s</em><span style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">&nbsp;is a string and&nbsp;</span><em style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">n</em><span style=\"font-family: \'Times New Roman\', Times, serif; font-size: 16px;\">&nbsp;is an integer&nbsp;</span></p>\n<pre style=\"font-size: 16px;\"><strong>C++</strong>\n<br />while(cin&gt;&gt;s&gt;&gt;n)\n<br />{\n<br />...\n<br />}\n<br /><strong>c</strong>\n<br />while(scanf(\"%s%d\",s,&amp;n)==2) //to  see if the scanf read in as many items as you want\n<br />/*while(scanf(%s%d\",s,&amp;n)!=EOF) //this also work    */\n<br />{\n<br />...\n<br />}</pre>','','2016-07-02 16:48:40',5,64,'N',1,1,0),(1005,'Knight Payment','<p>The lord&nbsp;pays his knight in gold coins. On the first day of his service, the knight receives one gold coin. On each of the next two days (the second and third days of service), the knight receives two gold coins. On each of the next three days (the fourth, fifth, and sixth days of service), the knight receives three gold coins. On each of the next four days (the seventh, eighth, ninth, and tenth days of service), the knight receives four gold coins. This pattern of payments will continue indefinitely: after receiving N gold coins on each of N consecutive days, the knight will receive N+1 gold coins on each of the next N+1 consecutive days, where N is any positive integer. &nbsp; Your program will determine the total number of gold coins paid to the knight in any given number of days (starting from Day 1).&nbsp;</p>','<p>The input contains at least one, but no more than 21 lines. Each line of the input file (except the last one) contains data for one test case of the problem, consisting of exactly one integer (in the range 1..10000), representing the number of days. The end of the input is signaled by a line containing the number 0.</p>','<p>There is exactly one line of output for each test case. This line contains the number of days from the corresponding line of input, followed by one blank space and the total number of gold coins paid to the knight in the given number of days, starting with Day 1.</p>','10\n6\n7\n11\n15\n16\n100\n10000\n1000\n21\n22\n0','10 30\n6 14\n7 18\n11 35\n15 55\n16 61\n100 945\n10000 942820\n1000 29820\n21 91\n22 98','0','','','2016-07-03 23:58:20',1,64,'N',1,1,0),(1006,'N的个数','<p>计算出最小的K，K由N个连续的数字组成，且能被整数M整除。</p>\n<p>举例，11是最小的由&lsquo;1&rsquo;组成的整数能被11整除，111111是最小的整数能被13整除，由6个&ldquo;1&rdquo;组成。</p>','<p>输入为一行，由两个正整数组成N和M，由空格分隔，M不大于10000</p>','<p>输出一行，为数字N的个数，如果不存在该数，输出0</p>','1 5 \n1 11 \n1 13','0\n2\n6','0','','','2016-07-06 01:40:44',1,64,'N',1,1,0),(110,'简单算术表达式','<p>计算只有加法和乘法两种运算的算术表达式。</p>','<p>输入仅有一行，为需要你计算的表达式，表达式中只包含数字、加法运算符&ldquo;+&rdquo;和乘法运算符&ldquo;*&rdquo;，且没有括号，所有参与运算的数字均为0到2^31-1之间的整数。输入数据保证这一行只有0~ 9、+、*这12种字符。</p>','<p>输出只有一行，包含一个整数，表示这个表达式的值。<strong>注意：当答案长度多于4位时，请只输出最后4位，前导0不输出。</strong></p>','1+1*3+4\n1+1234567890*1\n1+1000000003*1','8\n7891\n4','0','<p>对于30%的数据，0&le;表达式中加法运算符和乘法运算符的总数&le;100；</p>\n<p>对于80%的数据，0&le;表达式中加法运算符和乘法运算符的总数&le;1000；</p>\n<p>对于100%的数据，0&le;表达式中加法运算符和乘法运算符的总数&le;100000</p>','','2016-07-08 01:37:56',1,64,'N',1,1,0),(1008,'末尾淘汰选举 ','<p>&nbsp; &nbsp; &nbsp;&nbsp;该选举要求投票人列出候选人在心中的排名，第一轮计票只会统计每位投票人的第一选择，如果有一位候选人得到50%以上的票数，那么他就当选。如果没有人超过50%，那就淘汰票数最少的候选人，那些原本选择这个候选人的选票，则依照顺位将票投给下一个仍未出局的候选人。这个流程不断的重复(每一次的计票，票数最少的那些候选人都被排除当选)， 或者是所有剩下的候选人得票数相同才停止。&nbsp;</p>','<p>输入第一行为一个正整数N，表示共有N个测试选举，然后一列空白列。输入的第一列有一个整数n (n&lt;=20)代表候选人的个数。接下来的n列每一列依序表示了候选人的名字。这些名字可能长达80个可显示的字符。 &nbsp; 之后会有至多1000列，每一列包含了一张选票的内容。每一张选票都包含了一个1~n的排列，第一个数代表这张选票上的「第一选择」，第二个数字代表第二顺位&hellip;以此类推 &nbsp;&nbsp;</p>\n<p>&nbsp;</p>','<p>任意两块连续的测试选举之间输出一列空白。 &nbsp;</p>\n<p>对每一组测试选举输出赢得选举的候选人名字，或是同时打成平手的所有候选人名字。</p>','1\n3\nJohn Terry\nJane Smith\nMark Hughes\n1 2 3\n2 1 3\n2 3 1\n1 2 3\n3 1 2','John Terry','0','','','2016-07-08 19:38:42',3,64,'N',1,2,0),(1009,'自动判题脚本','<p>OJ 测试评判系统有三种输出结果分别为&ldquo;Accepted&rdquo;, &ldquo;Presentation Error&rdquo; or &ldquo;Wrong Answer&rdquo;. 这三种结果的定义如下:</p>\n<p>Accepted: 程序输出结果和标准答案完全比配，所有的字符、数字必须一一吻合，排列顺序相同。</p>\n<p>Presentation Error: 所有数字字符比配，排列顺序相同。但至少有一个非数字字符不同或排列顺序不同。比如字符串&lsquo;15 0&rsquo;和&lsquo;150&rsquo;属于&nbsp;&lsquo;Presentation Error&rsquo;；而字符串 &lsquo;15 0&rsquo; 和 &lsquo;1 0&rsquo;属于&lsquo;Wrong Answer&rsquo;。</p>\n<p>Wrong Answer: 如果输出结果不属于上述任何一种情况，那么将得到 &lsquo;Wrong Answer&rsquo; 结果。</p>','<p>由任意多组输入构成，每一组输入从一个正整数n（n&lt;100）开始，独占一行，表示有n行标准答案，之后n行输入为标准答案的字符内容。然后是一个正整数m（m&lt;100）独占一行，表示有m行程序执行答案，之后m行输入为程序执行答案的字符内容。输入遇到单独一行 n=0 表示输入结束。</p>\n<p>任何一行不会超过 120 个字符。</p>','<p>对于每一组输入会有一行输出对应：</p>\n<p>Run #x: Accepted</p>\n<p>Run #x: Presentation Error</p>\n<p>Run #x: Wrong Answer</p>\n<p>x表示第x组比对数据 (x从1开始).</p>','2\nThe answer is: 10\nThe answer is: 5\n2\nThe answer is: 10\nThe answer is: 5\n2\nThe answer is: 10\nThe answer is: 5\n2\nThe answer is: 10\nThe answer is: 15\n2\nThe answer is: 10\nThe answer is: 5\n2\nThe answer is: 10\nThe answer is: 5\n3\nInput Set #1: YES\nInput Set #2: NO\nInput Set #3: NO\n3\nInput Set #0: YES\nInput Set #1: NO\nInput Set #2: NO\n1\n1 0 1 0\n1\n1010\n1\nThe judges are mean!\n1\nThe judges are good!\n0','Run #1: Accepted\nRun #2: Wrong Answer\nRun #3: Presentation Error\nRun #4: Wrong Answer\nRun #5: Presentation Error\nRun #6: Presentation Error','0','','','2016-07-09 00:44:45',3,64,'N',1,1,0);
